export class HomeComponent {
    constructor(router, service, flavourService, category, occassionServe, ElByClassName) {
        this.router = router;
        this.service = service;
        this.flavourService = flavourService;
        this.category = category;
        this.occassionServe = occassionServe;
        this.ElByClassName = ElByClassName;
        this.categoryList = [];
        this.title = "CAKELICIOUS";
        this.load = true;
        this.occassionServe.getOccassion().subscribe((data) => {
            // console.log(data);
            this.occassionList = data;
        });
        this.category.getCategory().subscribe((data) => {
            // console.log(data);
            this.categoryList = data;
        });
        this.flavourService.getFlaovurList().subscribe((data) => {
            this.flavourList = data;
